import React from 'react';
import Header from "../../../helpers/headers/Headers";
import TitleAndServices from "../../../helpers/TitleAndServices";
import Calculation from "./Calculation";

function Prices(props) {
    return (
        <>
            <Header prices={true}/>
            <div className="body global-margin">
                <TitleAndServices title="Вычеслить цену"/>
                <div style={{
                    marginTop: "2rem"
                }}/>
                <Calculation/>
            </div>
        </>

    );
}

export default Prices;
